INSERT INTO `departments` VALUES (101, '行政部门', '行政管理类', '负责医疗管理系统的日常行政事务，包括人员招聘、员工培训、会议组织、行政文件管理等。', '2023-11-30 12:00:00', '2023-12-01 23:49:36');
INSERT INTO `departments` VALUES (102, '安全部门', '行政管理类', '负责医院安全和保卫工作，包括安全巡查、门禁管理、突发事件应急处理等。', '2023-11-30 12:00:00', '2023-12-01 23:49:40');
INSERT INTO `departments` VALUES (103, '财务部门', '行政管理类', '负责医院财务管理，包括预算编制、费用核算、财务报表分析、资金管理等。', '2023-11-30 12:00:00', '2023-12-01 23:49:43');
INSERT INTO `departments` VALUES (104, '法务部门', '行政管理类', '负责处理医院法律事务，包括合规性审核、法律咨询、合同管理、纠纷解决等。', '2023-11-30 12:00:00', '2023-12-01 23:49:45');
INSERT INTO `departments` VALUES (105, '人力资源部门', '行政管理类', '负责医院人力资源管理，包括招聘、培训、绩效考核、员工福利管理等。', '2023-11-30 12:00:00', '2023-12-01 23:49:47');
INSERT INTO `departments` VALUES (201, '医务部门', '医疗服务类', '负责医院的医疗服务管理，包括医生排班、病历管理、医疗质量评估、医疗流程优化等。', '2023-11-30 12:00:00', '2023-12-01 23:49:49');
INSERT INTO `departments` VALUES (202, '护理部门', '医疗服务类', '负责护理服务的管理，包括护士排班、护理记录、护理质量控制、患者护理计划等。', '2023-11-30 12:00:00', '2023-12-01 23:49:51');
INSERT INTO `departments` VALUES (301, '采购部门', '后勤保障类', '负责医院物资和设备的采购工作，包括供应商选择、采购合同管理、库存控制等。', '2023-11-30 12:00:00', '2023-12-01 23:49:54');
INSERT INTO `departments` VALUES (302, '卫生部门', '后勤保障类', '负责医院卫生环境管理，包括清洁消毒、垃圾处理、传染病防控等。', '2023-11-30 12:00:00', '2023-12-01 23:49:56');
INSERT INTO `departments` VALUES (303, '饮食部门', '后勤保障类', '负责医院饮食服务管理，包括餐饮计划制定、食材采购、餐饮质量控制等。', '2023-11-30 12:00:00', '2023-12-01 23:49:58');
INSERT INTO `departments` VALUES (304, '能源部门', '后勤保障类', '负责医院能源管理，包括水电供应、能源消耗监控、能源节约措施等。', '2023-11-30 12:00:00', '2023-12-01 23:50:00');
INSERT INTO `departments` VALUES (401, '建筑部门', '设施维护类', '负责医院建筑设施管理，包括维护保养、改造工程、环境设施规划等。', '2023-11-30 12:00:00', '2023-12-01 23:50:03');
INSERT INTO `departments` VALUES (402, '设备维护部门', '设施维护类', '负责医疗设备的维修、保养和管理工作，确保设备正常运行。', '2023-11-30 12:00:00', '2023-12-01 23:50:05');
INSERT INTO `departments` VALUES (501, '信息技术部门', '技术支持类', '负责医疗信息系统的开发、维护和管理，包括电子病历系统、医院管理系统等的实施与支持。', '2023-11-30 12:00:00', '2023-12-01 23:50:07');
